import { useState } from "react";

const useRandomNumber = (initialValue = 0) => {
  const [randomNumber, setRandomNumber] = useState(initialValue);

  const generateRandomNumber = () => {
    const newRandomNumber = Math.floor(Math.random() * 100); // Generate a random number between 0 and 99
    setRandomNumber(newRandomNumber);
  };

  return [randomNumber, generateRandomNumber];
};

export default useRandomNumber;
